data.value:
Входной алфавит X:
	ц – цифра (от 0 до 9);
	* – операция умножения;
	/ – операция деления;
	- – операция вычитания;
	+ – операция сложения;
	= – вывод результата на экран;
	R – возврат в начальное состояние.
	M – запись значения в блок памяти.

Выходной алфавит Y:
	y0 – введена цифра;
	y1 – введено число;
	y2 – ввод значения операции;
	y3 – получение результата;
	y4 – помещение результата в память;
	y5 – вывод из памяти;
	y6 – сброс.

Состояния S:
	S0 – начальное состояние «0»;
	S1 – отображение вводимого числа;
	S2 – отображение операции;
	Sр – вывод результата операции;
	Sп – помещение результата в память.
